(2595, 'https://covers.openlibrary.org/b/id/13032411-L.jpg', 'Little Women', 'Louisa May Alcott', 'Jilin wen shi chu ban she', 'Louisa May Alcotts classic novel, set during the Civil War, has always captivated even the most reluctant readers. Little girls, especially, love following the adventures of the four March sisters--Meg, Beth, Amy, and most of all, the tomboy Jo--as they experience the joys and disappointments, tragedies and triumphs, of growing up. This simpler version captures all the charm and warmth of the original.', 'Roman', '2002', '9787806262870', 'français', 'Disponible', 1, 324),
