(2965, 'https://covers.openlibrary.org/b/id/7183508-L.jpg', 'Divina Commedia', 'Dante Alighieri', 'Tipografia Regia', 'De goddelijke komedie is de beschrijving van een denkbeeldige tocht door het hiernamaals. Zij heeft drie delen: de hel, het vagevuur en het paradijs en ieder van deze delen heeft drieëndertig zangen van niet geheel gelijke lengte, terwijl aan het eerste deel nog een inleidende zang voorafgaat, waardoor het totale aantal van de zang honderd bedraagt. Dit aantal is geen toevalligheid. Het getal honderd gold in de middeleeuwse getallensymboliek, waarvan ook Dante een naarstig beoefenaar was, als...', 'Roman', '1866', '9780000000001', 'français', 'Disponible', 1, 300),
