(3113, 'https://covers.openlibrary.org/b/id/15129541-L.jpg', 'Dracula', 'Bram Stoker', 'Principis', 'Na história, um casal e seus amigos são atormentados por Conde Drácula, uma entidade sobrenatural e hematófoga que, presa em uma maldição contagiosa, pretende se mudar de seu recluso castelo na Transilvânia para a efervescente Londres do século XIX. Com a ajuda do professor Van Helsing, o grupo de amigos pretende enfrentar o morto-vivo, mesmo com todos os perigos que a ofensiva trará.', 'Roman', '2020', '9786555520002', 'français', 'Disponible', 1, 368),
